import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderComponent } from './shared/header/header.component';
import { FooterComponent } from './shared/footer/footer.component';
import { HomeComponent } from './pages/home/home.component';
import { RentersComponent } from './pages/renters/renters.component';
import { CarComponent } from './pages/car/car.component';
import { HomeownersComponent } from './pages/homeowners/homeowners.component';
import { PetComponent } from './pages/pet/pet.component';

import { HeroSectionComponent } from './shared/hero-section/hero-section.component';
import { FeaturesSectionComponent } from './shared/features-section/features-section.component';
import { LifeComponent } from './pages/life/life.component';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    FooterComponent,
    HomeComponent,
    RentersComponent,
    CarComponent,
    HomeownersComponent,
    PetComponent,
    LifeComponent,
    HeroSectionComponent,
    FeaturesSectionComponent
  ],
  imports: [
    BrowserModule,
    BrowserAnimationsModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
